import React from 'react';
import './Row.css';

function Row({ title, genre, releaseDate, htlb, timePlayed, status, score }) {
  return (
    <div className="row">
      <div className="gameInfo"> 
        <span>{title}</span>
        <span>{genre}</span>
        <span>{releaseDate}</span>
        <span>{htlb}</span>
        <span>{timePlayed}</span>
        <span>{status}</span>
      </div>
      <span className="score">{score}</span>
    </div>
  );
}

export default Row;
